tables.table_schema:
CREATE TABLE training_programs (
    program_id INT PRIMARY KEY,
    program_name VARCHAR(50),
    program_description TEXT
);

CREATE TABLE training_programs (
    program_id INT PRIMARY KEY,
    program_name VARCHAR(50) NOT NULL,
    program_type VARCHAR(20) NOT NULL
);

CREATE TABLE athlete_training (
    athlete_id INT,
    program_id INT,
    FOREIGN KEY (athlete_id) REFERENCES athletes(athlete_id),
    FOREIGN KEY (program_id) REFERENCES training_programs(program_id)
);

CREATE TABLE TrainingPrograms(
    program_id INT PRIMARY KEY,
    program_name VARCHAR,
    difficulty_level VARCHAR,
    duration INT
);

CREATE TABLE AthleteTrainingProgram(
    athlete_id INT,
    program_id INT,
    FOREIGN KEY (athlete_id) REFERENCES Athletes(athlete_id),
    FOREIGN KEY (program_id) REFERENCES TrainingPrograms(program_id)
);

CREATE TABLE training_programs (
  program_id UUID PRIMARY KEY,
  program_name VARCHAR(255) NOT NULL,
  program_description TEXT,
  duration_days INT
);

CREATE TABLE athlete_program_preferences (
  athlete_id UUID,
  program_id UUID,
  preference_order INT,
  PRIMARY KEY (athlete_id, program_id)
);

CREATE TABLE athlete_stats (
  athlete_id UUID PRIMARY KEY,
  height FLOAT,
  weight FLOAT,
  max_lift_amount INT
);
